import React, { useEffect } from "react";
import { Page, Document } from 'react-pdf';
import resume from './../public/data/mani/mani.pdf'

function Resume({profile}) {
    useEffect(() => {
        console.log(profile)
    })
    return (
        <>
            <Document file={resume}>
            <Page pageNumber={1} />
            </Document>
        </>
    );
};

export default Resume;
